import React from "react";

const Forecast = () => {
  fetch(
    "api.openweathermap.org/data/2.5/weather?q=&appid=e6ab6c3c45cc9e2e821ff0301eb9da23"
  )
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.error(err);
    });

  return <div>lol</div>;
};
